def hasGroupsSizeX(deck):
    dict1 = {}
    for x in deck:
        if x in dict1:
            dict1[x] += 1
        else:
            dict1[x] = 1

    resArr = list(dict1.values())
    g = resArr[0]
    for y in resArr :
        g = getPubNum(y, g)
    
    return g >= 2

def getPubNum(x, y) :
    return y if x == 0 else getPubNum(y % x , x)


